import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import {Container} from "@mui/material";

export default function Person() {
    return (
        <Container>
            <Box
                component="form"
                sx={{
                    '& > :not(style)': {m: 1, width: '25ch'},
                }}
                noValidate
                autoComplete="off"
            >
                <TextField id="standard-basic" label="Имя и Фамилия" variant="standard"/>
                <TextField id="standard-basic" label="С кем вы будете?" variant="standard"/>
            </Box>
        </Container>
    );
}
